import './MovCon.css';

export default function MovCon(props){
    return(
        <div className='movie-info'>
            <img src={props.Poster_Link} alt="movie-img" />
            <h4 className='title'>Title: {props.Series_Title}</h4>
            <p className='year'>Year: {props.Released_Year}</p>
            <p className='duration'>Duration: {props.Runtime}</p>
            <p className='genre'>Genre: {props.Genre}</p>
            <p className='rating'>IMDB Rating: {props.IMDB_Rating}</p>
        </div>
    );
}
